pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./proof/Dealer.sol";
import "./Pool.sol";
import "./interfaces/ISettings.sol";
import "./interfaces/IFactory.sol";

/**
    部署合约：
        设置dealer地址

    创建池子：
        有权限的地址可创建池子----拥有nft且getDealerStatus值为true
        该池子对应的所有者为创建池子时对应id的nft
 */
contract Factory is Ownable, ISettings, IFactory {

    address public dealer;
    address public player;

    uint256 public override marginRatio;
    uint256 public override protocolFee;
    uint256 public override liqProtocolFee;
    address public override priceAddress;
    address public override protocolReceipt;
    mapping(address => bool) public override pools;

    constructor(
        uint256 marginRatio_, 
        uint256 protocolFee_, 
        uint256 liqProtocolFee_, 
        address priceAddress_, 
        address protocolReceipt_
    ) {
        marginRatio = marginRatio_;
        protocolFee = protocolFee_;
        liqProtocolFee = liqProtocolFee_;
        priceAddress = priceAddress_;
        protocolReceipt = protocolReceipt_;

        emit SetMarginRatio(marginRatio_);
        emit SetProtocolFee(protocolFee_);
        emit SetLiqProtocolFee(liqProtocolFee_);
        emit SetPriceAddress(priceAddress_);
        emit SetProtocolReceipt(protocolReceipt_);
    }

    // typ: oracle 类型
    // 1 chain link
    // 2 uni swap v2
    // 3 uni swap v3
    // 4 sushi swap v2
    // 5 camelot
    function createPool(uint256 id, address payToken, address oracle, bool reverse, uint8 typ) external onlyDealerAndType(id) {
        Pool pool = new Pool(payToken, oracle, reverse, typ, id, dealer, player);
        pool.transferOwnership(owner());

        pools[address(pool)] = true;

        Dealer(dealer).setDealerToPool(id, address(pool));
        Dealer(dealer).setDealerType(id, 1);
        emit CreatePool(address(pool), payToken, oracle, reverse, typ, id);
    }

    function setDealer(address dealer_) external onlyOwner {
        dealer = dealer_;
    }

    function setPlayer(address player_) external onlyOwner {
        player = player_;
    }

    function setMarginRatio(uint256 marginRatio_) external onlyOwner {
        marginRatio = marginRatio_;
        emit SetMarginRatio(marginRatio_);
    }

    function setProtocolFee(uint256 protocolFee_) external onlyOwner {
        protocolFee = protocolFee_;
        emit SetProtocolFee(protocolFee_);
    }

    function setLiqProtocolFee(uint256 liqProtocolFee_) external onlyOwner {
        liqProtocolFee = liqProtocolFee_;
        emit SetLiqProtocolFee(liqProtocolFee_);
    }

    function setPriceAddress(address priceAddress_) external onlyOwner {
        priceAddress = priceAddress_;
        emit SetPriceAddress(priceAddress_);
    }

    function setProtocolReceipt(address protocolReceipt_) external onlyOwner {
        protocolReceipt = protocolReceipt_;
        emit SetProtocolReceipt(protocolReceipt_);
    }

    modifier onlyDealerAndType(uint256 id) {
        require(Dealer(dealer).getDealerStatus(id) && Dealer(dealer).ownerOf(id) == msg.sender, "not Dealer");
        _;
    }
}
